// File: contracts/TroversePlanets.sol

// contracts/TroversePlanets.sol
pragma solidity ^0.7.0;

import "../contracts/requirements.sol";


// Inspired/Copied from BGANPUNKS V2 (bastardganpunks.club)
contract TroversePlanets is ERC721, Ownable {
    using SafeMath for uint256;
    uint public constant MAX_PLANETS = 10000;
    bool public hasSaleStarted = false;
    
    // The IPFS hash for all Troverse Planets concatenated *might* stored here once all Troverse Planets are issued
    string public METADATA_PROVENANCE_HASH = "";

    // Description
    string public constant R = "Troverse Planets are the planet NFTs in the Troverse World!";

    constructor() ERC721("Troverse Planets","TP")  {
    }
    
    function tokensOfOwner(address _owner) external view returns(uint256[] memory ) {
        uint256 tokenCount = balanceOf(_owner);
        if (tokenCount == 0) {
            // Return an empty array
            return new uint256[](0);
        } else {
            uint256[] memory result = new uint256[](tokenCount);
            uint256 index;
            for (index = 0; index < tokenCount; index++) {
                result[index] = tokenOfOwnerByIndex(_owner, index);
            }
            return result;
        }
    }
    
    function calculatePrice() public view returns (uint256) {
        require(hasSaleStarted == true, "Sale hasn't started");
        require(totalSupply() < MAX_PLANETS, "All Planets have been sold");

        uint currentSupply = totalSupply();
        if (currentSupply >= 9900) {
            return 1000000000000000000;        // 9900 - 10000: 1.00 ETH
        } else if (currentSupply >= 9500) {
            return 640000000000000000;         // 9500 - 9900:  0.64 ETH
        } else if (currentSupply >= 7500) {
            return 320000000000000000;         // 7500 - 9500:  0.32 ETH
        } else if (currentSupply >= 3500) {
            return 160000000000000000;         // 3500 - 7500:  0.16 ETH
        } else if (currentSupply >= 1500) {
            return 80000000000000000;          // 1500 - 3500:  0.08 ETH 
        } else if (currentSupply >= 500) {
            return 40000000000000000;          // 500 - 1500:   0.04 ETH 
        } else {
            return 20000000000000000;          // 0 - 500:     0.02 ETH
        }
    }
    
    function mintPlanet(uint256 numPlanets) public payable {
        require(totalSupply() < MAX_PLANETS, "All Planets have been sold");
        require(numPlanets > 0 && numPlanets <= 20, "You can mint minimum 1, maximum 20 Planets");
        require(totalSupply().add(numPlanets) <= MAX_PLANETS, "Exceeds MAX_PLANETS");
        require(msg.value >= calculatePrice().mul(numPlanets), "Ether value sent is below the price");

        for (uint i = 0; i < numPlanets; i++) {
            uint mintIndex = totalSupply();
            _safeMint(msg.sender, mintIndex);
        }
    }
    
    function reserve(uint256 numPlanets, address to) public onlyOwner {
        require(totalSupply() < MAX_PLANETS, "All Planets have been sold");
        require(totalSupply().add(numPlanets) <= MAX_PLANETS, "Exceeds MAX_PLANETS");

        for (uint i = 0; i < numPlanets; i++) {
            uint mintIndex = totalSupply();
            _safeMint(to, mintIndex);
        }
    }
    
    // God Mode
    function setProvenanceHash(string memory _hash) public onlyOwner {
        METADATA_PROVENANCE_HASH = _hash;
    }
    
    function setBaseURI(string memory baseURI) public onlyOwner {
        _setBaseURI(baseURI);
    }
    
    function startSale() public onlyOwner {
        hasSaleStarted = true;
    }

    function pauseSale() public onlyOwner {
        hasSaleStarted = false;
    }
    
    function withdrawAll() public payable onlyOwner {
        require(payable(msg.sender).send(address(this).balance));
    }

    function reserveGiveaway(uint256 numPlanets) public onlyOwner {
        uint currentSupply = totalSupply();
        require(totalSupply().add(numPlanets) <= 30, "Exceeded giveaway supply");
        uint256 index;
        // Reserved for giveaways and donations to the community
        for (index = 0; index < numPlanets; index++) {
            _safeMint(owner(), currentSupply + index);
        }
    }
}
